import React, { Component, Fragment } from 'react';
import Button from '@material-ui/core/Button';

class CurrentStatue extends Component {
    render() {
        return (
            <Fragment>
                <Button variant="contained"/>
            </Fragment>
        );
    }
}

export default CurrentStatue;
